<script type="text/javascript">
function keywordEnter(e){
    var eve = e || window.event;
    if(eve.keyCode == 13){
        keywordSearch();
    }
}

function keywordSearch(){
    if($.trim($("#keyword").val()) == ""){
        return;
    }
    $("#search_form").attr('action','<?php echo base_url() ?>search/'+$("#keyword").val());
    $("#search_form").submit();
}
</script>
